const styles = theme => ({
    paper: {
      padding: theme.spacing(4),
      elevation: 3,
      // width: theme.spacing(60),
    },
    formHeader: {
      marginBottom: theme.spacing(5),
    },
    form: {
      margin: theme.spacing(3),
    },
    formText: {
      margin: theme.spacing(2),
    },
    button: {
      marginTop: theme.spacing(3),
    },
  });

export default styles;
